/*Table structure for table `Shop_WaresPhoto` */

DROP TABLE IF EXISTS `Shop_WaresPhoto`;

CREATE TABLE `Shop_WaresPhoto` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор',
  `Shop_Wares_ID` bigint(20) NOT NULL COMMENT 'Товар',
  `Name` varchar(250) DEFAULT NULL COMMENT 'Название',
  `Imgs` varchar(250) DEFAULT NULL COMMENT 'Маленкьая картинка',
  `Imgb` varchar(250) DEFAULT NULL COMMENT 'Большая картинка',
  PRIMARY KEY (`ID`),
  KEY `Shop_Wares_ID` (`Shop_Wares_ID`),
  CONSTRAINT `Shop_WaresPhoto_ibfk_1` FOREIGN KEY (`Shop_Wares_ID`) REFERENCES `Shop_Wares` (`ID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=184 DEFAULT CHARSET=utf8 COMMENT='Фото товара';

